import Head from "next/head";
import Navbar from "./Navbar";
import Submenu from "./Submenu";
import styles from "./layout.module.css";
import Socials from "./Socials.js";

const Layout = (props) => (
  <div className={styles.container}>
    <Head>
      <title>Niels de Visser | Portfolio</title>
      <link href="https://fonts.googleapis.com/css2?family=Playfair+Display:ital,wght@0,400;0,700;1,400;1,700&display=swap" rel="stylesheet"></link>
      <link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.6.3/css/all.css" integrity="sha384-UHRtZLI+pbxtHCWp1t77Bi1L4ZtiqrqD80Kn4Z8NTSRyMA2Fd33n5dQ8lWUE00s/" crossOrigin="anonymous"></link>
    </Head>
    <div className={styles.topend_wrapper}>
    <div className={styles.desktop_spacer}></div>
       <div className={styles.navbar_wrapper}>
      <Navbar />
    </div>
    {/*  */}
    <div className={styles.swoosh_Bar}><svg preserveAspectRation="none" width="100%" height="74" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320" class={styles.swoosh_Unit}>
    <path fill="#a2d9ff" fill-opacity="0.25" d="M0,160L60,160C120,160,240,160,360,181.3C480,203,600,245,720,224C840,203,960,117,1080,122.7C1200,128,1320,224,1380,272L1440,320L1440,0L1380,0C1320,0,1200,0,1080,0C960,0,840,0,720,0C600,0,480,0,360,0C240,0,120,0,60,0L0,0Z"></path>
</svg></div></div>
    <div className={styles.mainContent}> {props.children}</div>

      <Socials />

  </div>
);

export default Layout;
